  j = Math.min(Math.ceil(cb_obj.end), source.data['ohlc_high'].length);\n\n    let max = Math.max.apply(null, source.data['ohlc_high'].slice(i, j)),\n        min = Math.min.apply(null, source.data['ohlc_low'].slice(i, j));\n    _bt_scale_range(ohlc_range, min, max, true);\n\n    if (volume_range) {\n        max = Math.max.apply(null, source.data['Volume'].slice(i, j));\n        _bt_scale_range(volume_range, 0, max * 1.03, false);\n    }\n\n}, 50);\n"},"id":"1900836","type":"CustomJS"},{"attributes":{"coordinates":null,"data_source":{"id":"1900486"},"glyph":{"id":"1900679"},"group":null,"hover_glyph":null,"muted_glyph":{"id":"1900681"},"nonselection_glyph":{"id":"1900680"},"view":{"id":"1900683"}},"id":"1900682","type":"GlyphRenderer"},{"attributes":{},"id":"1900872","type":"AllLabels"},{"attributes":{"data":{"Close":{"__ndarray__":"UrgeheshUkBI4XoUrqdRQClcj8L1uFFArkfhehQeUkApXI/C9dhRQD0K16NwHVJAw/UoXI8iUkDsUbgehUtSQOxRuB6FW1JAFK5H4XqUUkBI4XoUrqdSQEjhehSul1JAexSuR+F6UkBSuB6F60FSQD0K16NwTVJAPQrXo3A9UkCuR+F6FC5SQD0K16NwHVJA9ihcj8IVUkC4HoXrURhSQClcj8L1iFFAAAAAAACQUUAUrkfheqRRQBSuR+F6hFFASOF6FK73UUC4HoXrUdhRQHsUrkfh2lFArkfhehTuUUCamZmZmflRQOF6FK5HEVJAmpmZmZkZUkAzMzMzM+NRQNejcD0KF1JAAAAAAADwUUDhehSuR9FRQOF6FK5H0VFA16NwPQq3UUAUrkfhenRRQArXo3A96lFAKVyPwvW4UUDXo3A9CgdSQHE9CtejIFJAUrgehetxUkAfhetRuP5SQI/C9Shc31JACtejcD3qUkCF61G4HtVSQFyPwvUo3FJASOF6FK63UkDhehSuR6FSQNejcD0Kl1JACtejcD2aUkDhehSuR5FSQNejcD0Kp1JA7FG4HoW7UkAzMzMzM7NSQDMzMzMzk1JAFK5H4XqkUkBSuB6F62FSQPYoXI/CdVJAMzMzMzNjUkAfhetRuG5SQPYoXI/CJVJAzczMzMwsUkBmZmZmZkZSQIXrUbgepVJAXI/C9SicUkApXI/C9ahSQHE9CtejsFJAzczMzMysUkBcj8L1KMxSQNejcD0K51JA4XoUrkcxU0BxPQrXo/BSQKRwPQrX81JA9ihcj8IlU0Bcj8L1KBxTQMP1KFyPMlNAMzMzMzNDU0AzMzMzMxNTQMP1KFyPklJACtejcD16UkB7FK5H4WpSQClcj8L1OFJApHA9CtczUkCF61G4HiVSQK5H4XoUblJArkfhehROUkAfhetRuE5SQOF6FK5HUVJArkfhehQ+UkAAAAAAAGBSQLgehetRSFJAUrgehetRUkAzMzMzM4NSQClcj8L1iFJAKVyPwvVIUkCamZmZmVlSQAAAAAAAQFJAXI/C9ShMUkApXI/C9YhSQJqZmZmZqVJAmpmZmZnpUkAAAAAAAPBSQB+F61G4DlNA9ihcj8JVU0A9CtejcC1TQLgehetRWFNA9ihc
